import "./chart.css";
import { LineChart, Line, XAxis, 
    YAxis, CartesianGrid, Tooltip, Legend,
     ResponsiveContainer } from 'recharts';


function Chart() {

    const data = [
        {
          name: "Jan",
          "Active User": 4000,
        },
        {
            name: "Feb",
            "Active User": 4000,
          },
          {
            name: "Mar",
            "Active User": 4000,
          },
          {
            name: "Apr",
            "Active User": 3000,
          },
          {
            name: "May",
            "Active User": 4000,
          },
          {
            name: "Jun",
            "Active User": 3000,
          },
          {
            name: "Jul",
            "Active User": 3000,
          },
          {
            name: "Agu",
            "Active User": 4000,
          },
          {
            name: "Sept",
            "Active User": 3000,
          },
          {
            name: "Oct",
            "Active User": 4000,
          },
          {
            name: "Nov",
            "Active User": 3000,
          },
          {
            name: "Jan",
            "Active User": 4000,
          },
          {
            name: "Dec",
            "Active User": 3000,
          },
      ];


    return (
        <div className="chart">
            <h3 className="chartTitle">User Analytics</h3>
            <ResponsiveContainer width="100%" aspect={4 / 1}>
            <LineChart data={data}>
                <XAxis dataKey="name" stroke="#5550bd"/>
                <Line type="monotone" dataKey="Active User"/>
            </LineChart>
            </ResponsiveContainer> 
        </div>
    )
}

export default Chart
